class Matrix:

    def __init__(self, elements: List[List[Union[int, float]]]):
        """Initializes a Matrix object"""
        self._validate_input(elements)
        self.rows = [Row(row) for row in elements]
        self.columns = self._get_columns()

    # MATRIX INFORMATION
    def columns(self) -> list[list[int]]:
        return [[row[i] for row in self.rows] for i in range(len(self.rows[0]))]

    def _validate_input(self, elements: List[List[Union[int, float]]]):
        """Validates the input for the Matrix constructor"""
        if not elements or not all(elements):
            raise ValueError("Matrix cannot be empty")

        num_columns = len(elements[0])
        if not all(len(row) == num_columns for row in elements):
            raise ValueError("All rows must have the same number of elements")

    def _get_columns(self) -> List[List[Union[int, float]]]:
        """Returns the columns of the matrix"""
        return [[row[idx] for row in self.rows] for idx in range(len(self.rows[0]))]

    @property
    def num_rows(self) -> int:
        return len(self.rows)

    @property
    def num_columns(self) -> int:
        return len(self.rows[0])

    @property
    def order(self) -> tuple[int, int]:
        return self.num_rows, self.num_columns

    @staticmethod
    def identity(elements: Union[List[int], List[str]]) -> Union[List[int], List[str]]:
        return elements

    def determinant(self, matrix: List[List[Union[int, float]]]) -> Union[int, float]:
        """
        Calculate the determinant of a matrix.

        The determinant calculation is done using the method of minors of a matrix.

        :param matrix: list[list[int/float]] : a 2D list representing the matrix
        :return: int/float : determinant of the matrix
        """
        total = 0
        size = len(matrix)

        if size == 1:
            return matrix[0][0]

        # define submatrix for focus column
        for focus_col in range(size):
            sign = (-1) ** focus_col

            # call this function again for smaller matrix
            sub_matrix = self.minor(matrix, 0, focus_col)

            # add current result to the total calculation
            total += sign * matrix[0][focus_col] * self.determinant(sub_matrix)

        return total

    def minor(
        self, matrix: List[List[Union[int, float]]], row: int, col: int
    ) -> List[List[Union[int, float]]]:
        """Compute the minor of the matrix after removing specific row and column."""
        return [
            row[:col] + row[col + 1 :] for idx, row in enumerate(matrix) if idx != row
        ]

    def get_minor(
        self, removed_row: int, removed_col: int
    ) -> List[List[Union[int, float]]]:
        """Generates a minor matrix by removing specified row and column.

        Args:
            removed_row (int): The row number to be removed.
            removed_col (int): The column number to be removed.

        Returns:
            List[List[Union[int, float]]]: The minor matrix after the row and the column are removed.
        """
        return self._create_minor_matrix(removed_row, removed_col)

    def _create_minor_matrix(
        self, removed_row: int, removed_col: int
    ) -> List[List[Union[int, float]]]:
        """Creates a minor matrix by removing the specified row and column from the original matrix.

        Args:
            removed_row (int): The row number to be removed.
            removed_col (int): The column number to be removed.

        Returns:
            List[List[Union[int, float]]]: The minor matrix after the row and the column are removed.
        """
        return [
            row[:removed_col] + row[removed_col + 1 :]
            for i, row in enumerate(self.matrix)
            if i != removed_row
        ]

    @property
    def is_square(self) -> bool:
        return self.order[0] == self.order[1]

    def cofactors(self) -> List[List[Union[int, float]]]:
        """
        Calculate the matrix of cofactors
        """

        def calculate_cofactor(i: int, j: int) -> Union[int, float]:
            sub_matrix = [
                row[:j] + row[j + 1 :]
                for row in (self.matrix[:i] + self.matrix[i + 1 :])
            ]
            return ((-1) ** (i + j)) * Matrix.det(Matrix(sub_matrix))

        return [
            [calculate_cofactor(i, j) for j in range(self.cols)]
            for i in range(self.rows)
        ]

    def adjugate(self):
        """Computes the adjugate of the matrix."""
        if not self.is_square():
            raise ValueError("Cannot compute adjugate of a non-square matrix")

        def calculate_cofactor(
            sub_matrix: List[List[Union[int, float]]], i: int, j: int
        ) -> float:
            """Calculates the determinant of the submatrix formed by removing the i-th row and j-th column."""
            return (-1) ** (i + j) * Matrix(sub_matrix).determinant_simple()

        adjugate_matrix = list()
        for i in range(self.m):
            adjugate_row = [
                calculate_cofactor(self.delete_row_and_column(i, j), i, j)
                for j in range(self.n)
            ]
            adjugate_matrix.append(adjugate_row)

        return Matrix(transpose_matrix(adjugate_matrix))

    def is_invertable(self) -> bool:
        return bool(self.determinant())

    def get_cofactor(self, row: int, column: int) -> int:
        if (row + column) % 2 == 0:
            return self.get_minor(row, column)
        return -1 * self.get_minor(row, column)

    def __str__(self) -> str:
        return "\n".join(" ".join(str(cell) for cell in row) for row in self.matrix)

    def minors(self) -> Matrix:
        return Matrix(
            [
                [self.get_minor(row, column) for column in range(self.num_columns)]
                for row in range(self.num_rows)
            ]
        )

    def add_column(self, new_column: List[Union[int, float]]) -> None:
        """Add a new column to the matrix.

        Args:
            new_column (List[Union[int, float]]): List to be added as a new column.
        """

        self.validate_new_column(new_column)
        for index, value in enumerate(new_column):
            self.matrix[index].append(value)

    def validate_new_column(self, new_column: List[Union[int, float]]) -> None:
        """Check if the new column has the correct size to be added to the matrix.

        Args:
            new_column (List[Union[int, float]]): List to be added as a new column.

        Raises:
            ValueError: If the new column has wrong size.
        """

        if len(new_column) != len(self.matrix):
            raise ValueError("The new column size must match the matrix row size.")

    def inverse(self) -> Matrix:
        determinant = self.determinant()
        if not determinant:
            raise TypeError("Only matrices with a non-zero determinant have an inverse")
        return self.adjugate() * (1 / determinant)

    def __repr__(self) -> str:
        return str(self.rows)

    def __add__(self, other: "Matrix") -> "Matrix":
        """Performs addition of two Matrix instances."""
        if not isinstance(other, Matrix):
            raise ValueError("Both operands must be an instance of Matrix")

        if len(self.data) != len(other.data) or len(self.data[0]) != len(other.data[0]):
            raise ValueError("Matrices must be of the same dimensions to be added.")

        return self._add_matrices(self.data, other.data)


    def __sub__(self, other: "Matrix") -> "Matrix":
        if self._validate_dimensions(other):
            result = [
                [
                    self.matrix[i][j] - other.matrix[i][j]
                    for j in range(len(self.matrix[0]))
                ]
                for i in range(len(self.matrix))
            ]
            return Matrix(result)
        else:
            raise ValueError(
                "Both matrices must be of the same dimension for subtraction"
            )

    def _validate_dimensions(self, other: "Matrix") -> bool:
        return len(self.matrix) == len(other.matrix) and len(self.matrix[0]) == len(
            other.matrix[0]
        )

    @staticmethod
    def _add_matrices(
        matrix1: List[List[Union[int, float]]], matrix2: List[List[Union[int, float]]]
    ) -> "Matrix":
        """Returns the result of the addition of two matrices."""
        result = Matrix()
        result.data = [
            [val1 + val2 for val1, val2 in zip(row1, row2)]
            for row1, row2 in zip(matrix1, matrix2)
        ]
        return result

    # MATRIX MANIPULATION
    def add_row(self, row: list[int], position: int | None = None) -> None:
        type_error = TypeError("Row must be a list containing all ints and/or floats")
        if not isinstance(row, list):
            raise type_error
        for value in row:
            if not isinstance(value, (int, float)):
                raise type_error
        if len(row) != self.num_columns:
            raise ValueError(
                "Row must be equal in length to the other rows in the matrix"
            )
        if position is None:
            self.rows.append(row)
        else:
            self.rows = self.rows[0:position] + [row] + self.rows[position:]

    # MATRIX OPERATIONS
    def __eq__(self, other: object) -> bool:
        if not isinstance(other, Matrix):
            return NotImplemented
        return self.rows == other.rows

    def __ne__(self, other: object) -> bool:
        return not self == other

    def __neg__(self) -> Matrix:
        return self * -1

    def __mul__(self, other: Matrix | float) -> Matrix:
        if isinstance(other, (int, float)):
            return Matrix(
                [[int(element * other) for element in row] for row in self.rows]
            )
        elif isinstance(other, Matrix):
            if self.num_columns != other.num_rows:
                raise ValueError(
                    "The number of columns in the first matrix must "
                    "be equal to the number of rows in the second"
                )
            return Matrix(
                [
                    [Matrix.dot_product(row, column) for column in other.columns()]
                    for row in self.rows
                ]
            )
        else:
            raise TypeError(
                "A Matrix can only be multiplied by an int, float, or another matrix"
            )

    def __pow__(self, other: int) -> Matrix:
        if not isinstance(other, int):
            raise TypeError("A Matrix can only be raised to the power of an int")
        if not self.is_square:
            raise ValueError("Only square matrices can be raised to a power")
        if other == 0:
            return self.identity()
        if other < 0:
            if self.is_invertable():
                return self.inverse() ** (-other)
            raise ValueError(
                "Only invertable matrices can be raised to a negative power"
            )
        result = self
        for _ in range(other - 1):
            result *= self
        return result

    @classmethod
    def dot_product(cls, row: list[int], column: list[int]) -> int:
        return sum(row[i] * column[i] for i in range(len(row)))


